12_c02332f1-e986-0850-3f07-7b1d97620782\" CardinalityMin=\"1\" CardinalityMax=\"1\">\r\n                        <Element name=\"country\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6825_cbf94188-fd1c-6886-ee38-014f1ade0974\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation>contains the name of a geo-political unit, such as a nation, country, colony, or commonwealth, larger than or administratively superior to a region and smaller than a bloc. </Documentation>\r\n                            <AttributeList>\r\n                                <Attribute name=\"key\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6241_4fa5cd26-85f4-0cd7-3e64-198730224fea\" ValueScheme=\"string\"/>\r\n                            </AttributeList>\r\n                        </Element>\r\n                        <Element name=\"settlement\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6245_2e322e13-58b2-461b-4cba-af209c7f75af\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"1\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation> contains the name of a settlement such as a city, town, or village identified as a single geo-political or administrative unit.</Documentation>\r\n                        </Element>\r\n                        <Element name=\"institution\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6213_b30f2cad-2436-4aef-c73e-45053de4a1f5\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"1\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation>contains the name of an organization such as a university or library, with which a manuscript is identified, generally its holding institution.</Documentation>\r\n                        </Element>\r\n                        <Element name=\"repository\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6214_4460b492-b4e0-61ac-9045-43f2ed5ec4a8\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"1\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation>contains the name of a repository within which manuscripts are stored, possibly forming part of an institution.</Documentation>\r\n                        </Element>\r\n                        <Element name=\"idno\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-5353_4d1e6d19-15c0-0959-0b13-d9a57cd6cc86\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"1\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation>(identifier) supplies any form of identifier used to identify some object, such as a bibliographic item, a person, a title, an organization, etc. in a standardized way.</Documentation>\r\n                            <AttributeList>\r\n                                <Attribute name=\"type\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-5354_a4e41aa9-b8ba-59ea-a34e-6d7179e393be\" ValueScheme=\"string\"/>\r\n                            </AttributeList>\r\n                        </Element>\r\n                        <Element name=\"msName\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6824_ca741307-9b86-95d8-60db-3c912d199464\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"1\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                            <Documentation>(alternative name) contains any form of unstructured alternative name used for a manuscript, such as an ‘ocellus nominum’, or nickname. </Documentation>\r\n                        </Element>\r\n                    </Component>\r\n                    <Component name=\"msContents\" ComponentRef=\"clarin.eu:cr1:c_1407745712038\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6826_06ca241c-5191-f1a5-31af-1bf58d7e1874\" CardinalityMin=\"0\" CardinalityMax=\"1\">\r\n                        <Component name=\"msItem\" ComponentRef=\"clarin.eu:cr1:c_1407745712037\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6827_2a329598-bf1e-abcc-f593-1aecca0195ac\" CardinalityMin=\"1\" CardinalityMax=\"unbounded\">\r\n                            <AttributeList>\r\n                                <Attribute name=\"n\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6177_8e40366a-172a-9f6a-cc6a-fcb982209d53\" ValueScheme=\"string\"/>\r\n                            </AttributeList>\r\n                            <Element name=\"locus\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6828_acf2ae05-bc52-4820-26c9-9b6c118f091a\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation> defines a location within a manuscript or manuscript part, usually as a (possibly discontinuous) sequence of folio references</Documentation>\r\n                                <AttributeList>\r\n                                    <Attribute name=\"from\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6829_7424edae-b838-b112-ae88-1d898327984b\" ValueScheme=\"string\"/>\r\n                                    <Attribute name=\"to\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6830_03ce716c-c400-5828-dd8f-ef0c6f21fbad\" ValueScheme=\"string\"/>\r\n                                </AttributeList>\r\n                            </Element>\r\n                            <Element name=\"title\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6119_ea4226b5-8d55-e71e-730f-2a02e3adbeb4\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation> contains a title for any kind of work</Documentation>\r\n                                <AttributeList>\r\n                                    <Attribute name=\"type\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6240_c0c67c8b-b626-d601-731f-0ea67e51d4cd\" ValueScheme=\"string\"/>\r\n                                </AttributeList>\r\n                            </Element>\r\n                            <Element name=\"docAuthor\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6854_b6344bc9-d957-506f-950c-228f008a2bce\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation>(document author) contains the name of the author of the document, as given on the title page (often but not always contained in a byline)</Documentation>\r\n                            </Element>\r\n                            <Element name=\"docDate\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6855_a77ccd9e-3ceb-f04d-4f51-309654a7fcd0\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation> (document date) contains the date of a document, as given on a title page or in a dateline.</Documentation>\r\n                                <AttributeList>\r\n                                    <Attribute name=\"when\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6176_647a4954-a958-7304-d8a6-5851f2003f7c\" ValueScheme=\"string\"/>\r\n                                </AttributeList>\r\n                            </Element>\r\n                            <Element name=\"docImprint\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6869_b5fe37f7-3990-1f15-2093-289d