854_b6344bc9-d957-506f-950c-228f008a2bce\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation>(document author) contains the name of the author of the document, as given on the title page (often but not always contained in a byline)</Documentation>\r\n                            </Element>\r\n                            <Element name=\"docDate\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6855_a77ccd9e-3ceb-f04d-4f51-309654a7fcd0\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation> (document date) contains the date of a document, as given on a title page or in a dateline.</Documentation>\r\n                                <AttributeList>\r\n                                    <Attribute name=\"when\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6176_647a4954-a958-7304-d8a6-5851f2003f7c\" ValueScheme=\"string\"/>\r\n                                </AttributeList>\r\n                            </Element>\r\n                            <Element name=\"docImprint\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6869_b5fe37f7-3990-1f15-2093-289d9fe1beaa\" ValueScheme=\"string\" CardinalityMin=\"0\" CardinalityMax=\"unbounded\" Multilingual=\"false\" cue:DisplayPriority=\"1\" xmlns:cue=\"http://www.clarin.eu/cmd/cues/1\">\r\n                                <Documentation>(document imprint) contains the imprint statement (place and date of publication, publisher name), as given (usually) at the foot of a title page.</Documentation>\r\n                            </Element>\r\n                            <Element name=\"textLang\" ConceptLink=\"http://hdl.handle.net/11459/CCR_C-6852_7a13f56b-c2ba-c7da-9888-6f12531095b5\" ValueScheme=